import React, { useState, useEffect } from "react";
import Axios from "../../node_modules/axios";
// import { useHistory } from "react-router-dom"
//import "../components/TestIndex.css";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";

function Indexinter() {
  var inteobj
  let titems

  Axios.get("http://interviewapi.stgbuild.com/getQuizData").then((response) => {
    console.log(response.data.tests);
    inteobj = response.data.tests
    console.log(inteobj)

    titems = inteobj.map((number) =>
    <tr>
    <td>{number}</td>
    <td>50</td>
    <td>
      <a href="test.html" class="btn btn-warning">
        Start Test
      </a>
    </td>
  </tr>
  )
  });





  return (
    <>
      <div class="container">
        <div class="row">
          <h1>My Interview Portal</h1>
          <hr/>
          <div class="col-md-12">
            <table class="table table-striped">
              <thead>
                <tr>
                  <th>Test</th>
                  <th>No of Questions</th>
                  <th></th>
                </tr>
              </thead>
              <tbody>
              {titems}
              </tbody>
            </table>
          </div>
        </div>
        API Url:{" "}
        <a href="http://interviewapi.stagging.in/getQuizData" target="_blank">
          http://interviewapi.stagging.in/getQuizData
        </a>
      </div>
    </>
  );
}

export default Indexinter;
